-- Create ports table
CREATE TABLE ports (
    code varchar(200) NOT NULL,
    name varchar(200) NOT NULL,
    parent_slug varchar(200) NOT NULL
);
-- Create prices table
CREATE TABLE prices (
    orig_code varchar(200) NOT NULL,
    dest_code varchar(200) NOT NULL,
    day date NOT NULL,
    price integer NOT NULL
);
-- Create regions table
CREATE TABLE regions (
    slug varchar(200) NOT NULL,
    name varchar(200) NOT NULL,
    parent_slug varchar(200)
);
